import React, { Component } from 'react'
import Particles from "react-particles-js";
export class Particles_component extends Component
{
    render()
    {
        return (

                <div
                    style={{
                        position: "absolute",
                        top: 0,
                        left: 0,
                        width: "100%",
                        height: "100%"
                    }}
                >
                    <Particles
                        params={{
                        particles: {
                            number: {
                                value: 400
                            },
                            color: {
                                value: "#344455",
                                animation: {
                                    enable: true,
                                    speed: 40,
                                    sync: false
                                }
                            },
                            shape: {
                                type: "circle",
                            },
                            size: {
                                value: 6,
                                random: true,
                                animation: {
                                    enable: true,
                                    speed: 20,
                                    minimumValue: 0.1,
                                    sync: false
                                },
                                move: {
                                    enable: true,
                                },
                            }
                        }
                            }}
                            />

            </div>
        )
    }
}

export default Particles_component
